import React, {useState} from 'react'

const Payslip_Form = () => {

    const [formData, setFormData] = useState({
        e_id: "",
        e_name: "",
        e_department: "",
        e_designation: "",
        e_CPFGPF: "",
        deductions: "",
        totalSalary: "",
      });
    
      // Handle input changes
      const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
      };
    
      // Handle form submission
      const handleSubmit = (e) => {
        e.preventDefault();
        const { basicSalary, deductions } = formData;
        const totalSalary = basicSalary - deductions;
    
        // Update state with total salary
        setFormData((prev) => ({
          ...prev,
          totalSalary,
        }));
    
        alert("Payslip created successfully!");
      };

  return (
    <div className="flex items-center justify-center min-h-screen bg-gray-100">
      <div className="w-full max-w-lg p-8 bg-white shadow-lg rounded-lg">
        <h2 className="text-2xl font-bold text-center text-gray-800 mb-6">
          Create Payslip
        </h2>
        <form onSubmit={handleSubmit} className="space-y-6">
          {/* Name */}
          <div>
            <label
              htmlFor="name"
              className="block text-sm font-medium text-gray-700"
            >
              Employee Name
            </label>
            <input
              type="text"
              id="name"
              name="name"
              value={formData.name}
              onChange={handleChange}
              required
              placeholder="Enter employee's name"
              className="w-full px-4 py-2 mt-1 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            />
          </div>

          {/* Designation */}
          <div>
            <label
              htmlFor="designation"
              className="block text-sm font-medium text-gray-700"
            >
              Designation
            </label>
            <input
              type="text"
              id="designation"
              name="designation"
              value={formData.designation}
              onChange={handleChange}
              required
              placeholder="Enter employee's designation"
              className="w-full px-4 py-2 mt-1 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            />
          </div>

          {/* Basic Salary */}
          <div>
            <label
              htmlFor="basicSalary"
              className="block text-sm font-medium text-gray-700"
            >
              Basic Salary
            </label>
            <input
              type="number"
              id="basicSalary"
              name="basicSalary"
              value={formData.basicSalary}
              onChange={handleChange}
              required
              placeholder="Enter basic salary"
              className="w-full px-4 py-2 mt-1 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            />
          </div>

          {/* Deductions */}
          <div>
            <label
              htmlFor="deductions"
              className="block text-sm font-medium text-gray-700"
            >
              Deductions
            </label>
            <input
              type="number"
              id="deductions"
              name="deductions"
              value={formData.deductions}
              onChange={handleChange}
              required
              placeholder="Enter deductions"
              className="w-full px-4 py-2 mt-1 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            />
          </div>

          {/* Submit Button */}
          <button
            type="submit"
            className="w-full px-4 py-2 text-white bg-blue-600 rounded-md hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-blue-500"
          >
            Generate Payslip
          </button>
        </form>

        {/* Display Result */}
        {formData.totalSalary && (
          <div className="mt-6 p-4 bg-green-100 rounded-md">
            <h3 className="text-lg font-semibold text-green-700">Payslip:</h3>
            <p className="text-gray-700">
              <strong>Name:</strong> {formData.name}
            </p>
            <p className="text-gray-700">
              <strong>Designation:</strong> {formData.designation}
            </p>
            <p className="text-gray-700">
              <strong>Total Salary:</strong> ₹{formData.totalSalary}
            </p>
          </div>
        )}
      </div>
    </div>
  )
}

export default Payslip_Form
